import io
import re
import pytz
from dateutil.rrule import *
from dateutil.parser import *
from datetime import *
from core import models


def import_events(venue,iCal_file):

	def frequency_number(frequency):
		return ['YEARLY','MONTHLY','WEEKLY','DAILY','HOURLY','MINUTELY','SECONDLY'].index(frequency)

	def day_number(day_string):
		return ['MO','TU','WE','TH','FR','SA','SU'].index(day_string)

	def split_by_day(by_day):
		day_string = by_day.lstrip('0123456789-')

		bysetpos = by_day[:-len(day_string)]
		if bysetpos:
			bysetpos = int(bysetpos)

		days = day_string.split(',')
		days = tuple(day_number(day) for day in days)

		return bysetpos, days

	file = io.StringIO(iCal_file.strip())

	summary = ' '
	dtstart = None
	dtend = None
	timezone = None
	recurring = False

	event = None
	freq = None
	interval = 1
	count = None
	until = None
	bysetpos = None
	bymonth = None
	bymonthday = None
	byyearday = None
	byeaster = None
	byweekno = None
	byweekday = None
	byhour = None
	byminute = None
	bysecond = None	
	wkst = day_number('MO')

	for line in file:
		#Handle dates without timezones, odd date lines (sometimes they have ";" in them for some reason)
		if line.startswith('DTSTART;') or line.startswith('DTEND;'):
			field, _, right_half = line.partition(';')
			zone_data, _, data = right_half.partition(':')
			key, _, value = zone_data.partition('=')
			if key == 'TZID':
				timezone = pytz.timezone(value)
		elif line.startswith('SUMMARY;'):
			field, _, right_half = line.partition(';')
			zone_data, _, data = right_half.partition(':')
			summary = data
		else:
			field, _, data = line.partition(':')

		#Set event details
		if field == 'SUMMARY':
			summary = data.split('\n')[0]
		
		#Set start date/time
		elif field == 'DTSTART':
			if timezone:
				dtstart = timezone.localize(parse(data.split('\n')[0]))
			else:
				if len(data) == 9:
					#TODO: Use iCal file's global timezone as the default
					dtstart = pytz.timezone('America/Toronto').localize(datetime.strptime(data, '%Y%m%d\n'))
				else:
					dtstart = parse(data.split('\n')[0])

		#Set end date/time
		elif field == 'DTEND':
			if timezone:
				dtend = timezone.localize(parse(data.split('\n')[0]))
			else:
				if len(data) == 9:
					#TODO: Use iCal file's global timezone as the default
					dtend = pytz.timezone('America/Toronto').localize(datetime.strptime(data, '%Y%m%d\n')) - timedelta(minutes=1)
				else:
					dtend = parse(data.split('\n')[0])

		#Set rules for recurring dates
		elif field == 'RRULE':
			recurring = True
			repeat_line = data.split('\n')[0]
			conditions = repeat_line.split(';')

			for condition in conditions:
				key, _, value = condition.partition('=')
				if key == 'FREQ':
					freq = frequency_number(value)
				elif key == 'INTERVAL':
					interval = int(value)
				elif key == 'COUNT':
					count = int(value)
				elif key == 'UNTIL':
					if timezone:
						until = timezone.localize(parse(value).replace(tzinfo=None))
					else:
						until = parse(value)
				elif key == 'BYMONTH':
					bymonth = value
				elif key == 'BYMONTHDAY':
					bymonthday = int(value)
				elif key == 'BYYEARDAY':
					byyearday = int(value)
				elif key == 'BYEASTER':
					byeaster = value
				elif key == 'BYWEEKNO':
					byweekno = value
				elif key == 'BYWEEKDAY' or key == 'BYDAY':
					bysetpos, byweekday = split_by_day(value)
				elif key == 'BYHOUR':
					byhour = value
				elif key == 'BYMINUTE':
					byminute = value
				elif key == 'BYSECOND':
					bysecond = value
				elif key == 'WKST':
					wkst = day_number(value)

		#All values set, now create the event(s)
		elif (field == 'END' and 'VEVENT' in data.split('\n')[0]) or (field == 'BEGIN' and 'VALARM' in data.split('\n')[0]):

			#Verify mandatory fields
			#Also, don't include anythig older than roughly a year ago.
			if dtstart != None and dtend != None and dtstart.year >= datetime.now().year - 1:
				#Create recurring event
				if recurring :
					if not count and not until:
						count = [3,24,52,52,52,52,52][freq]

					event_dates = list(rrule(freq, dtstart=dtstart,
												   interval=interval, 
												   wkst=wkst, 
												   count=count, 
												   until=until, 
												   bysetpos=bysetpos, 
												   bymonth=bymonth, 
												   bymonthday=bymonthday, 
												   byyearday=byyearday, 
												   byeaster=byeaster, 
												   byweekno=byweekno, 
												   byweekday=byweekday, 
												   byhour=byhour, 
												   byminute=byminute, 
											       bysecond=bysecond))

					event_length = dtend - dtstart

					for date in event_dates:
						end_date = date + event_length
						event = models.Event.objects.create(
							venue=venue,
							title=summary,
							event_type=0,
							start_time=date,
							end_time=date + event_length
							)

				#Create static event
				else:
					event = models.Event.objects.create(
						venue=venue,
						title=summary,
						event_type=0,
						start_time=dtstart,
						end_time=dtend
						)
			else:
				print('No start/end time for entry...')
				print('Details: ' + str(summary))
				print('Start: ' + str(dtstart))
				print('End: ' + str(dtend))
				print('Recurring: ' + str(recurring))
				print('-----')

			summary = ' '
			dtstart = None
			dtend = None
			timezone = None

			recurring = False

			freq = None
			interval = 1
			count = None
			until = None
			bysetpos = None
			bymonth = None
			bymonthday = None
			byyearday = None
			byeaster = None
			byweekno = None
			byweekday = None
			byhour = None
			byminute = None
			bysecond = None	
			wkst = None	

			print(event)

